Embed Field: Query with unknown keys in mongodb<p>I have a collection with documents like:</p>

<pre><code>{   
   map:{
     key1:value1,
     key2:value2, 
     ....
    }
}
</code></pre>

<p>and I want to filter documents based on map values only, regardless the keys, something like map.* equal some value. Is it possible to do that?</p>

<p>MongoDB version used is 3.4</p>; Answer: @paxdiablo: There's no need to dynamically create a format string for `printf`-like functions as they already support dynamic parameters (`*` special character): for example `printf("%*.*f", total, decimals, x);` outputs a number with the dynamically specified total field length and decimals.

